import 'style.css'

const KnowLedge = () => {
    const knowledgeList = [
        {
            title: 'Java',
            logo: 'java-logo.png'
        },
        {
            title: 'JavaScript',
            logo: 'js-logo.png'
        },
        {
            title: 'Git',
            logo: 'git-logo.png'
        },
        {
            title: 'NodeJS',
            logo: 'nodejs.png'
        },
        {
            title: 'Spring',
            logo: 'spring-logo'
        },
        {
            title: 'React JS',
            logo: 'react-logo'
        },
        {
            title: 'MySQL',
            logo: 'mysql-logo'
        },
    ]

    return (
        <section id='knowledge'>
            <div id='text-side'>
                <h2>Conhecimento</h2>
                <span>Isso Ã© um pouco do que eu sei</span>
            </div>
            <div id='logos-side'>
                {knowledgeList.map(item => (
                    <div className='knowledge-item'>
                        <img src={`images/logo/${item.logo}`} alt={`${item.title} logo`} />]
                        <span>{item.title}</span>
                    </div>
                ))}
            </div>
        </section>
    )
}


export default KnowLedge
